    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service New
    Mexico Ecological Services Field Office (Service) submitted a Use Study Proposal
    (USFWS 1996) in response to the settlement agreement and to evaluate the existing
    and attainable uses of four watercourses on Los Alamos National Laboratory. This
    proposal was accepted by the interested parties.  The proposal focused on the assessment
    of attainable uses, because the beneficial use of waters to support aquatic life
    can often require stringent numeric standards be applied to a discharge and can
    often be a contested use in arid regions where aquatic life can be sparse.   Specific
    objectives of the Phase II study were threefold: 1) determine the toxicity of site
    waters to the cladoceran Ceriodaphnia dubia (life cycle test with reproductive endpoint)
    and to young fathead minnows (Pimephales promelas; 96 hour test with lethality endpoint);
    2) determine the toxicity of sediment pore waters to C. dubia (life cycle test with
    reproductive endpoint); and 3) measure water quality including metal concentrations
    of surface waters, pore waters, and of sediments from which pore waters were extracted.",nt"owner_org":
